    inputPages.name = "input-pages";
    inputPages.placeholder = "Page count";
    inputPages.setAttribute("oninput", "this.value = this.value.replace(/[^0-9]/g, '').replace(/(\\..*)\\./g,'$1');");
    inputFieldsDiv.appendChild(inputPages);

